<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">At Learn with Legends, we make posting and selling gigs easier than ever before. Unlike our competitors, who burden freelance sellers with exorbitant fees, our platform prioritizes the success and prosperity of our gig sellers. We charge a significantly lower fee to all our sellers, ensuring that they can make ends meet without struggle.</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">But that&#39;s not all! When a gig sells on our platform, we take it a step further. 100% of the fees generated from the sale are shared among all verified members of Learn with Legends. This means that not only will you be earning from your own gigs, but you&#39;ll also have the opportunity to receive a share of the fees from other successful gigs on the platform.</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></p></div><div id="comp-ljt3mapx" class="LE0APo comp-ljt3mapx wixui-image"><div data-testid="linkElement" class="bWtdXu"><wow-image id="img_comp-ljt3mapx" class="HlRz5e xG6Gwj" data-image-info="{&quot;containerId&quot;:&quot;comp-ljt3mapx&quot;,&quot;displayMode&quot;:&quot;fill&quot;,&quot;targetWidth&quot;:311,&quot;targetHeight&quot;:221,&quot;isLQIP&quot;:true,&quot;imageData&quot;:{&quot;width&quot;:1280,&quot;height&quot;:929,&quot;uri&quot;:&quot;6dee8a_d8de5de282bb4da88ee19d9128ffdf2d~mv2.png&quot;,&quot;name&quot;:&quot;meeting-g65dd6ebb5_1280.png&quot;,&quot;displayMode&quot;:&quot;fill&quot;}}" data-bg-effect-name="" data-has-ssr-src="true"><img src="https://static.wixstatic.com/media/6dee8a_d8de5de282bb4da88ee19d9128ffdf2d~mv2.png/v1/fill/w_76,h_55,al_c,q_85,usm_0.66_1.00_0.01,blur_2,enc_auto/meeting-g65dd6ebb5_1280.png" alt="meeting-g65dd6ebb5_1280.png" style="width:100%;height:100%;object-fit:cover;object-position:50% 50%"/></wow-image></div></div><div id="comp-ljt9iq68" class="KcpHeO tz5f0K comp-ljt9iq68 wixui-rich-text" data-testid="richTextElement"><h2 class="font_2 wixui-rich-text__text" style="font-size:70px; line-height:normal; text-align:center;"><span style="font-size:70px;" class="wixui-rich-text__text"><span class="color_15 wixui-rich-text__text"><span style="letter-spacing:0.12em;" class="wixui-rich-text__text"><span style="font-family:playfairdisplay-bold,playfair display,serif;" class="wixui-rich-text__text">WHY?</span></span></span></span></h2></div><div id="comp-ljt8day1" class="KcpHeO tz5f0K comp-ljt8day1 wixui-rich-text" data-testid="richTextElement"><p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">In the current world, many individuals find themselves caught in a flawed system that prioritizes profit over personal fulfillment. This system doesn&#39;t require your success or happiness; it simply demands that you continue to function, fulfilling your duties while perpetually chasing materialistic desires. While a fortunate few may acquire their dream homes, cars, and start families, a carefully orchestrated plan by the World Economic Forum presents a looming obstacle. This organization, comprised of powerful and influential individuals, aims to systematically increase the challenges of daily life, ensuring that any wealth accumulated ultimately returns to their grasp, either through your own actions or by passing it down to the next generation.</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">Their ultimate objective? Complete control and obedience within a godless system where individuals are left possessing nothing. It is in this disheartening landscape that Learn with Legends emerges as the singular solution. If we have any hope of effecting positive change and collaborating for a better future, this is our opportunity.</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">The world is facing numerous compound issues, perpetuated by corrupt corporations that manipulate regulations to enhance their own wealth generation. They exploit the system to attain desired lands and resources, effectively amassing assets and real estate that serve as tax write-offs, granting them the ability to evade taxes. These entities leverage their wealth as collateral to acquire loans from banks, subsequently utilizing these funds to further grow their assets, repeating this cycle of wealth accumulation. As this cycle repeats, it perpetuates the widening wealth gap and exacerbates the challenges of daily life. Governments resort to printing more money to sustain the constant inflation caused by this cycle, leading to a host of additional issues.</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">Learn with Legends provides the antidote to this growing predicament. If we, as people, fail to unite and support this transformative system, we will inadvertently subject our children to the consequences of our ignorance and unwillingness to change. Let us be on the right side of history and join Learn with Legends without delay.</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">Embrace this opportunity to create a brighter future by joining Learn with Legends today!</span></p></div><div id="comp-ljt9jsvw" class="MazNVa comp-ljt9jsvw wixui-image"><div data-testid="linkElement" class="j7pOnl"><wow-image id="img_comp-ljt9jsvw" class="HlRz5e BI8PVQ" data-image-info="{&quot;containerId&quot;:&quot;comp-ljt9jsvw&quot;,&quot;displayMode&quot;:&quot;fill&quot;,&quot;targetWidth&quot;:600,&quot;targetHeight&quot;:971,&quot;isLQIP&quot;:true,&quot;imageData&quot;:{&quot;width&quot;:791,&quot;height&quot;:1280,&quot;uri&quot;:&quot;6dee8a_4610f8b2a438499cb194730977d148c0~mv2.png&quot;,&quot;name&quot;:&quot;monopoly-g59d653374_1280.png&quot;,&quot;displayMode&quot;:&quot;fill&quot;}}" data-bg-effect-name="" data-has-ssr-src="true"><img src="https://static.wixstatic.com/media/6dee8a_4610f8b2a438499cb194730977d148c0~mv2.png/v1/fill/w_60,h_97,al_c,q_85,usm_0.66_1.00_0.01,blur_2,enc_auto/monopoly-g59d653374_1280.png" alt="monopoly-g59d653374_1280.png" style="width:100%;height:100%;object-fit:cover;object-position:50% 50%"/></wow-image></div></div><div id="comp-ljtaiy58" class="KcpHeO tz5f0K comp-ljtaiy58 wixui-rich-text" data-testid="richTextElement"><h2 class="font_2 wixui-rich-text__text" style="font-size:70px; line-height:normal; text-align:center;"><span style="font-size:70px;" class="wixui-rich-text__text"><span class="color_15 wixui-rich-text__text"><span style="letter-spacing:0.12em;" class="wixui-rich-text__text"><span style="font-family:playfairdisplay-bold,playfair display,serif;" class="wixui-rich-text__text">How?</span></span></span></span></h2></div><div id="comp-ljtajdm7" class="KcpHeO tz5f0K comp-ljtajdm7 wixui-rich-text" data-testid="richTextElement"><p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">Together we can revolutionize the way we distribute wealth and tackle economic inequality. The world&#39;s top six companies currently hold a mind-boggling combined worth of over $14 trillion, which surpasses the funds needed to establish a universal basic income. However, instead of paying their fair share of taxes, these companies continue to accumulate assets and further burden the lives of ordinary people.</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">But envision a different reality where these companies actually share their revenue. Regrettably, this is not the case. However, this is where our platform comes into play. By joining forces and becoming a member of our community, we can create something extraordinary. Our platform, designed to learn from industry legends, allows us to share a portion of the revenue with all verified members, ensuring a fair and just distribution of wealth.</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">Together, we have the power to compete with these corporate giants. Rather than exacerbating existing issues, we choose to reinvest our earnings directly back into the hands of our members. By doing so, we effectively circulate money, helping to combat inflation and alleviate everyday stresses for many individuals.</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">Just considering our marketplace alone, which rivals the likes of Amazon that earns over $8 billion per month, we have the potential to share an incredible $8 billion each month with our members. Simply by joining and verifying their accounts, individuals can access this transformative opportunity.</span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text"><span class="wixGuard wixui-rich-text__text">​</span></span></p>

<p class="font_8 wixui-rich-text__text" style="font-size:20px; text-align:center;"><span style="font-size:20px;" class="wixui-rich-text__text">But that&#39;s not all - we have much more in store. With the growing support from our community, our ability to develop and expand rapidly also increases. The solution is remarkably straightforward. If we truly believe that we are made in the image of God, then let us act accordingly. Together, let&#39;s abandon the corrupt approach to wealth accumulation and work towards a grand vision never seen or accomplished before. When countless individuals, all created in the image of God, unite and harness their power, we have the capability to move mountains.</span></p></div><section id="comp-ljwfhu7r" class="comp-ljwfhu7r CohWsy wixui-column-strip"><div id="bgLayers_comp-ljwfhu7r" data-hook="bgLayers" class="if7Vw2"><div data-testid="colorUnderlay" class="tcElKx i1tH8h"></div><div id="bgMedia_comp-ljwfhu7r" class="wG8dni"></div></div><div data-testid="columns" class="V5AUxf"><div id="comp-ljwfhu9z" class="comp-ljwfhu9z YzqVVZ wixui-column-strip__column"><div id="bgLayers_comp-ljwfhu9z" data-hook="bgLayers" class="MW5IWV"><div data-testid="colorUnderlay" class="LWbAav Kv1aVt"></div><div id="bgMedia_comp-ljwfhu9z" class="VgO9Yg"></div></div><div data-mesh-id="comp-ljwfhu9zinlineContent" data-testid="inline-content" class=""><div data-mesh-id="comp-ljwfhu9zinlineContent-gridContainer" data-testid="mesh-container-content"><div id="comp-ljwfiqih" class="KcpHeO tz5f0K comp-ljwfiqih wixui-rich-text" data-testid="richTextElement"><h2 class="font_2 wixui-rich-text__text" style="font-size:22px; line-height:normal; text-align:center;"><span class="color_15 wixui-rich-text__text"><span style="letter-spacing:0em;" class="wixui-rich-text__text"><span style="font-size:22px;" class="wixui-rich-text__text"><span style="font-family:arial black,arial-w01-black,arial-w02-black,arial-w10 black,sans-serif;" class="wixui-rich-text__text"><?= User::count